name: All-Butter Pie Crust
servings: 1 9-inch crust
source: New York Times Cooking
source_url: https://cooking.nytimes.com/recipes/448-pie-crust
prep_time: 15 minutes
categories: [bakery, pie]
notes: |
  Some people shy away from making pie crusts. Here is a recipe to banish all fear, a simple dough of butter and all-purpose flour, easy to make and dependable as can be. If you plan to make a pie with a top crust, double the recipe; when it's time to chill the dough, divide it in half and shape into two disks to put in the fridge. The dough will also keep for 3 months in the freezer, if you want to stash a few disks thre. Defrost in the fridge overnight.
  For the best results, use a high-fat, European-style unsalted butter like Plugra.
ingredients: |
  1¼ cups all-purpose flour (150 grams)
  ¼ teaspoon fine sea salt
  10 tablespoons unsalted butter, cold and cut into cubes
  2 to 4 tablespoons ice water, as needed
directions: |
  In a food processor, pulse together the flour and salt. Add butter and pulse until the mixture forms lima bean-size pieces. Slowly add ice water, 1 tablespoon at a time, and pulse until the dough just comes together. It should be moist, but not wet. 
  Turn dough out onto a lightly floured surface and gather into a ball. Flatten into a disk with the heel of your hand. Cover tightly with plastic wrap and refrigerate for at least 1 hour and up to 2 days.
